def reverse_complement(pattern: str) -> str:
    """Calculate the reverse complement of a DNA pattern."""
    stack = [] 
    for s in pattern:
        stack.append(help(s))
    res = []
    for i in range(len(stack)):
        res.append(stack.pop())
    return ''.join(res)
    
def help(s):
    if s == "A": return "T"
    elif s == "T": return "A"
    elif s == "G": return "C"
    else: return "G"
