def pattern_matching(pattern: str, genome: str) -> list[int]:
    """Find all occurrences (index) of a pattern in a genome."""
    res = []
    for i in range(len(genome) - len(pattern) + 1 ):
        if genome[i:i+len(pattern)] == pattern:
            res.append(i)
    return res

